import React from "react";

function PieChart() {
  return (
    <section>
      <div className="relative flex w-auto items-center h-auto z-0">
        <img src="/statistics.jpg" />
      </div>
      <div className="relative flex container mx-auto article-container z-10">
        <article>
          <p></p>
        </article>
      </div>
    </section>
  );
}

export default PieChart;
